import React, { useState } from "react";
import { Bar } from 'react-chartjs-2';
const piedata = {
    labels: ['Fats', 'Protein', 'Sugar',
        'Carbs', 'Sodium'],
    datasets: [{
        label: 'Nutrition',
        backgroundColor: [
            '#B21F00',
            '#C9DE00',
            '#2FDE00',
            '#00A6B4',
            '#6800B4'
        ],
        hoverBackgroundColor: [
            '#501800',
            '#4B5000',
            '#175000',
            '#003350',
            '#35014F'
        ],
        data: [65, 59, 80, 81, 56]
    }]
};

var DoughnutChart = props => {
    return (
        <Doughnut
            data={piedata}
            options={{
                title: {
                    display: true,
                    text: 'Daily Nutrition',
                    fontSize: 20
                },
                legend: {
                    display: true,
                    position: 'right'
                }
            }}
        />
    );
};

export default BarChart;
